import React from "react"
import ReactDOM from "react-dom"

const TodoList = () => {
    return(
        <ul>
            <li>Learn React</li>
            <li>Drink coffee</li>
        </ul>
    )
}

const appHeader = () => {
    return (
        <h1>My todo list</h1>
    )
}

const SearchPanel = () => {
    return (
        <input placeholder="search" />
    )
}

const App = () => {
    return (
        <div>
            <appHeader />
            <SearchPanel />
            <TodoList />
        </div>
    )
}

ReactDOM.render(<App />,
    document.getElementById('root'))
